  'event: tool_call_result\ndata: {"thread_id": "019a215955c91b42a9871f198619aac027", "agent": "researcher", "id": "bdb30191-d6d6-4026-87c9-218adaa8d1d7", "role": "assistant", "checkpoint_ns": "researcher:e312620c-c7aa-ba9a-20b9-950c864102aa", "langgraph_node": "tools", "langgraph_path": ["__pregel_pull", "tools"], "langgraph_step": 9, "content": "[{\\"type\\": \\"page\\", \\"title\\": \\"华为2024年年度报告发布，年营收8621亿元研发投入达到1797亿元\\", \\"url\\": \\"https://wap.eastmoney.com/a/202504013361466930.html\\", \\"content\\": \\"写评论 ...\\\\n\\\\n 点赞\\\\n 举报\\\\n\\\\n打开APP 读海量资讯\\", \\"score\\": 0.7325349}, {\\"type\\": \\"page\\", \\"title\\": \\"华为2024年研发投入1797亿！近十年累计投入超12490亿 - 新浪财经\\", \\"url\\": \\"https://finance.sina.com.cn/tech/discovery/2025-04-01/doc-inerpuqk8160081.shtml\\", \\"content\\": \\"新浪科技> 科学探索 > 正文\\\\n\\\\n# 华为2024年研发投入1797亿！近十年累计投入超12490亿\\\\n\\\\n华为2024年研发投入1797亿！近十年累计投入超12490亿\\\\n\\\\n2025年03月31日 16:14\\\\n快科技\\\\n\\\\n新浪财经APP\\\\n缩小字体\\\\n放大字体\\\\n收藏\\\\n微博\\\\n微信\\\\n分享\\\\n\\\\n腾讯QQ\\\\nQQ空间\\\\n\\\\n快科技3月31日消息，今日，华为发布2024年年度报告，报告显示，华为经营结果符合预期，实现全球销售收入8621亿元，净利润626亿元。\\\\n\\\\n研发方面，2024年，华为研发费用支出为1797亿元，约占全年收入的20.8%，近十年累计投入的研发费用超过12490亿元。\\\\n\\\\n根据年报，截至2024年12月31日，华为研发员工约11.3万名，占总员工数量的54.1%。\\\\n\\\\n通过多年持续在基础领域的创新，目前 华为是全球最大的专利持有企业之一，在全球共持有有效授权专利超过15万件。\\\\n\\\\n据了解，华为在蜂窝通信、短距通信、音视频编解码等多个主流标准 专利领域居于领先地位，已经有数百家企业通过双边协议或专利池付费获得了华为的专利许可，截至2024年底，已累计签署超230份许可协议。 [...] 【本文结束】如需转载请务必注明出处：快科技\\\\n\\\\n责任编辑：拾柒\\\\n\\\\n华为专利通信费用\\\\n\\\\n新浪科技公众号\\\\n\\\\n“掌”握科技鲜闻 （微信搜索techsina或扫描左侧二维码关注）\\\\n\\\\n0条评论|0人参与网友评论\\\\n\\\\n表情\\\\n\\\\n登录|注册\\\\n\\\\n|退出\\\\n\\\\n分享到微博\\\\n\\\\n发布\\\\n\\\\n最热评论 刷新\\\\n\\\\n最新评论 刷新\\\\n\\\\n更多精彩评论>>\\\\n\\\\n相关新闻\\\\n\\\\n财经头条作者库\\\\n\\\\n### 创事记\\\\n\\\\n 何小鹏罗永浩对谈3小时：揭秘换掉十几位高管背后，回顾至暗时刻\\\\n 翻了10倍后，7000亿公募新帅的老难题\\\\n 单月投放10亿、资本支出翻倍，腾讯元宝还没突围\\\\n\\\\n 氛围编程师崛起！年薪87万一天15小时，Karpathy用400行AI代码点燃硅谷\\\\n 我在SKP排队三小时，和代购抢老铺黄金\\\\n OpenAI称有DeepSeek「偷窃」证据？美军已发起攻击！Anthropic CEO喊话加强芯片管制\\\\n\\\\n### 阅读排行榜\\\\n\\\\n### 评论排行榜 [...] ### 众测\\\\n\\\\n四款618国补家用台式净水器对比评测\\\\n\\\\n 极空间私有云Q4试用征集中\\\\n\\\\n### 来电聊\\\\n\\\\n2018新浪科技风云榜回顾\\\\n\\\\n 2018新浪科技风云榜回顾\\\\n\\\\n### 专题\\\\n\\\\n海外周选——每周一个有趣故事\\\\n\\\\n 海外周选——每周一个有趣故事\\\\n\\\\n### 官方微博\\\\n\\\\n### 公众号\\\\n\\\\n新浪科技\\\\n\\\\n苹果汇\\", \\"score\\": 0.6907474}, {\\"type\\": \\"page\\", \\"title\\": \\"【智能时代】华为海思：全球领先半导体设计公司，芯片国产化先锋 ...\\", \\"url\\": \\"https://zhuanlan.zhihu.com/p/16560027291\\", \\"content\\": \\"华为海思凭借自主研发的昇腾与鲲鹏体系，在此背景下，脱颖而出，共同构筑国产AI算力坚实底座，成为目前国产AI算力最重要供应商。\\\\n\\\\n六、随着海思芯片产品不断取得突破，海思收入规模快速增长。\\\\n\\\\n2018年，海思收入规模约76亿美元/550亿人民币，同比增长34%，在全球半导体设计公司中排名第5，实现中国半导体企业历史性突破。\\\\n\\\\n2024年，预计海思全年收入有望达300亿美元/2,000亿人民币量级，相比2018年增长接近3倍，年复合增长率26%；海思收入规模可能重返全球半导体设计公司前5，仅次于英伟达、英特尔、博通、高通，超过AMD。\\\\n\\\\n七、海思作为中国芯片国产化先锋力量，带领中国芯片产业链整体崛起，成为中国打造半导体全产业链自主可控的带头人。\\\\n\\\\n近年来，中美大国博弈持续激烈，科技成为主战场，芯片产业成为美国限制中国科技发展、中国谋求创新突破的关键点。\\\\n\\\\n2019年后，受美国制裁，海思与台积电合作终止，海思迅速调整战略方向，开始将目光投向以中芯国际为代表的国内芯片生产商，积极探索与国内供应链合作模式。\\", \\"score\\": 0.6768127}]", "round_id": "828c8e79-e457-4d75-93df-b52510f9435a", "step_name": "华为芯片综合能力分析", "tool_call_id": "call_00_lXvQxFJllF44dqGBKQ0pSDyp"}\n\n',
